import './Homepage.css'
function Homepage()
{
    return(
        <div className="mainHomepage">
            <div className="links">
            <button>Catalogue</button>
            <button>Chat</button>
            <button>Book Service</button>
            <button>Images</button>
            <button>CEO</button>
            </div>

            <div className="center">
                <h1>Find Out </h1>
            </div>
        </div>
    );
}
export default Homepage
